import ViewSubmissions from "./pages/ViewSubmissions";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* âœ… DEFAULT PAGE */}
        <Route path="/" element={<Dashboard />} />

        {/* Other pages */}
        <Route path="/new" element={<NewSubmission />} />
        <Route path="/view" element={<ViewSubmissions />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
